    _quantity = quantity;
    _cartTotal = cartTotal;
    _createdAt = createdAt;
    _updatedAt = updatedAt;
    _campaign = campaign;
  }

  ApiCartItem.fromJson(dynamic json) {
    _id = json['id'];
    _campaignId = json['campaign_id'];
    _userId = json['user_id'];
    _quantity = json['quantity'];
    _cartTotal = json['cart_total'];
    _createdAt = json['created_at'];
    _updatedAt = json['updated_at'];
    _campaign = json['campaign'] != null ? ApiCampaign.fromJson(json['campaign']) : null;
  }
  int? _id;
  int? _campaignId;
  int? _userId;
  int? _quantity;
  dynamic _cartTotal;
  String? _createdAt;
  String? _updatedAt;
  ApiCampaign? _campaign;
  ApiCartItem copyWith({  int? id,
    int? campaignId,
    int? userId,
    int? quantity,
    dynamic cartTotal,
    String? createdAt,
    String? updatedAt,
    ApiCampaign? campaign,
  }) => ApiCartItem(  id: id ?? _id,
    campaignId: campaignId ?? _campaignId,
    userId: userId ?? _userId,
    quantity: quantity ?? _quantity,
    cartTotal: cartTotal ?? _cartTotal,
    createdAt: createdAt ?? _createdAt,
    updatedAt: updatedAt ?? _updatedAt,
    campaign: campaign ?? _campaign,
  );
  int? get id => _id;
  int? get campaignId => _campaignId;
  int? get userId => _userId;
  int? get quantity => _quantity;
  dynamic get cartTotal => _cartTotal;
  String? get createdAt => _createdAt;
  String? get updatedAt => _updatedAt;
  ApiCampaign? get campaign => _campaign;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['campaign_id'] = _campaignId;
    map['user_id'] = _userId;
    map['quantity'] = _quantity;
    map['cart_total'] = _cartTotal;
    map['created_at'] = _createdAt;
    map['updated_at'] = _updatedAt;
    if (_campaign != null) {
      map['campaign'] = _campaign?.toJson();
    }
    return map;
  }

  set campaign(ApiCampaign? value) {
    _campaign = value;
  }

